(1, 'Kallanai Dam', '-Karikala chola\r\n -Around 2,000 years ago across the Kaveri River', 'The dam though very old has a strong foundation and a solid structure. It is still in excellent condition and is used as a major irrigation dam in Tamil Nadu. The dam has also been an inspiration for many recent modern day dams due to its amazing engineering. Due to its impressive architecture, the dam attracts a lot of tourists every year.', '-Rock Fort Temple\r\n -Jambukeswarar Temple\r\n -Sri Ranganathaswamy Temple\r\n -Zapp Adventure Sports\r\n -The travel Planet', 'Tiruchirappalli District,Tamilnadu,India'),
(2, 'Solaiyar Dam', '-Leadership of John Pennyquick\r\n -Completed:1895\r\n -Opened:1965', 'Sholayar Dam is the second deepest dam in Asia', '-Nallamudi View point\r\n -Malakkapara View Point\r\n -Upper Sholayar Dam\r\n -Vagamalai\r\n -Idamalayar Reserve Forest', 'Valparai,Coimbatore Distric,Tamil Nadu,India'),
(3, 'Aliyar Dam', '-Kamarajar\r\n -Constructed during 1959-1969 across the Aliyar river.', 'Purpose of the dam is to support irrigation for Pollachi and near by places for Agriculture purpose.', '-Nallamudi Viewpoint\r\n -Chinna Kallar Falls\r\n -Monkey Falls\r\n -Aliyar Dam Reservoir Park\r\n -Koolangal River', 'Between Pollachi and Valparai Coimbatore District,Tamil Nadu,India');

