(1, 'Mudumalai National Park', '-Winters and the onset of Summers\r\n -October to May', '-Jungle Safari\r\n -Elephant Safari\r\n -Elephant camps\r\n -Trekking in the forest\r\n -Bird watching', '-Needle Rock View Point\r\n -Pykara Lake\r\n -Wenlock Downs\r\n -Pine Tree Forests\r\n -Tea Estate View Point', '-Rs.30 per person Entry fee\r\n -Rs.53 for Still Camera\r\n -Rs.315 for Video Camera\r\n -Rs.340 per person For Bus safari\r\n -Rs.4200 per trip For Jeep safari\r\n -Rs.1120 per trip For Elephant safari', '-2-4 Hours\r\n  -Monday to Sunday:Morning 7 am to 9 am -Evening 3 pm to 6 pm', 'Theppakadu,Nilgiri District,TamilNadu,India'),
(2, 'Indira Gandhi Wildlife Sanctuary', 'October to March', '-The park comprises of around 8,000 species of plants.\r\n -It has some of the more fierce and aggressive creatures like Tigers, Panthers, Wild Boar, Sloth Boar etc.', '-TNAU Botanical Garden.\r\n -Arulmigu Patteeswarar Swamy Temple.\r\n -Ramar Temple.\r\n -Tamil Nadu Agricultural University.\r\n -Brookefields Mall.\r\n -Marudhamalai Hill Temple.\r\n -Vellingiri Hill Temple.', '-School Children from Government and aided Schools - Rs.2.00\r\n -School Children from Private Schools- Rs.10.00 Adult : 15.00.\r\n -Still Camera: Rs.25\r\n -Handy Camera / Video Camera - Rs.150\r\n -Charges for documentary educational films using Handy camera and Video Camera - Rs.2000.\r\n -Parking vehicle charges : Heavy vehicle : Rs.50 \r\n -Motor car/van Rs. 15.00\r\n -Motor Cycle : Rs. 5', '-Open 6.30am to 6.30pm\r\n -1-2 Hours', 'Pollachi,Tamil Nadu,India'),
(3, 'Point Calimere Wildlife and Bird Sanctuary', 'November and January-for Birds', 'This vast swampy tract of point calimere is the scene of one of India\"s greatest avian spectacles', '-Ramar Padam: The Footprint of Rama\r\n -Navakodi Sitthar Aalayam\r\n -Point Calimere Adivasi Colony\r\n -Shevrayan Kovil\r\n -Sanyasin Muniaswar Kovil', '10 per person', '-2 to 4 Hours\r\n -Everyday 7:00 am to 6:00 pm', 'Kodiyakadu,Nagapattinam District,Tamil Nadu,India');

