INSERT INTO `temple` (`id`, `deity`, `templename`, `famousfor`, `pooja`, `festivals`, `location`) VALUES
(1, 'Lord Shiva', 'Brihadeeswara Temple', 'The temple has a massive colonnaded prakara (corridor) and one of the largest Shiva lingas in India. It is also famed for the quality of its sculpture, as well as being the location that commissioned ', '-KalaSandi-9:00 am\r\n-UchiKalam-12:00 pm\r\n-Sayyaraitchai-6:00 pm\r\n-ArthaJaamam-8:00 pm', '-Masi-Shivarathiri\r\n-Aippasi-Pournami\r\n-Panguni-Thiruvizha\r\n-Margazhi-Thiruvadhirai', 'Membalam Rd, Balaganapathy Nagar, Thanjavur, Tamil Nadu 613007'),
(2, 'Lord Vishnu', 'Descent of the Ganges', 'Once ruled by the Pallavas, famed for their excellent architecture and sculptures, Mahabalipuram has beautiful rock-cut monuments that draws architects, history enthusiasts and travellers from around ', '-Open on all days: 06:00 AM to 6:00 PM\r\n\r\n   -Entry Fees:\r\n Indian   :10Rs\r\n Foreigner: 250Rs\r\n-Duration:\r\n    Approx 1-2 hrs', 'Descent of the Ganges attracts numerous tourists on a large scale. Not only the domestic visitors but, the foreign nationals also arrive and admire the beauty of this monument. It can be visited throu', 'Mamallapuram,Chengalpattu District,Tamil Nadu,India'),
(3, 'Lord Shiva', 'Ekambareswarar Temple', 'This vast temple is famous for its huge \'Gopuram\' which dominates the skyline of the temple town of Kanchipuram.', '-Koo Pooja-6:00am\r\n   -Ukshakala Pooja-6:30 am to 7:30 am\r\n   -Kala Santhi Pooja-7:30 am to 8:30 am\r\n   -Uchikala Pooja-11:30 am to 12:00 pm\r\n   -Paradhosa Kaalam-6:00 pm to 7:00 pm', '-Ani Tirumanjanam\r\n   -Aadi Krithikai\r\n   -Avani Moolam\r\n   -Thai Poosam\r\n   -Karthikai Deepam\r\n   -Panguni Uthiram', 'Ekambaranathar Sannidhi Street, Periya, Kanchipuram, Tamil Nadu 631502'),
(4, 'Lakshmi Narayani or Mahalakshmi', 'Golden Temple', 'This holy temple is considered as one of the biggest golden temples in the world which covers an area of 404685 square m.', '-4.00 am to 8.00 am Abishekam\r\n -8.00 am to 8.00 pm General Dharshan\r\n -6.00 pm to 7.00 pm Aarthi Seva', '-(7.23 km) Jalakandeswarar Temple\r\n -(7.21 km) Vellore Fort\r\n -(6.25 km) Sri Lakshmi Narsimha Swamy Temple', 'Sri Narayani Peedam,Thirumalaikodi,Vellore,Tamil Nadu'),
(5, 'Lord Shiva', 'Kanchi Kailasanathar Temple', 'The kanchi Kailasanathar temple is the oldest structure in Kanchipuram. Located in Tamil Nadu, India, it is a Hindu temple in the Dravidian architectural style. It is dedicated to Lord Shiva, and is known for its historical importance. ', 'The best time to visit the Kanchi Kailasanathar Temple is in February and March when the celebrations of the Maha Shivratri festival are ongoing. Visiting the temple during this time is considered to be extremely auspicious.', 'The most popular festival celebrated here is the Maha Shivratri, which is celebrated in a rather grand manner every year on the thirteenth night and fourteenth day of the Magha month of the Hindu calendar.', 'Pillaiyarpalayam,Kanchipuram,Tamil Nadu,India'),
(6, 'Lord Shiva', 'Kapaleeshwarar Temple', 'The Kapaleeswarar Temple in Mylapore, Chennai is a very ancient temple. The original temple was submerged under the sea & the current temple structure was a later construction. The Moolavar is Kapaleeswarar & Amman is Karpagambal.', '-Ko pooja 05.00 A.M\r\n -Vaikarai Pooja 06.00 A.M.\r\n -Kaala sandhi Pooja 08.00 A.M.\r\n -Uchi Kaala Pooja 12.00 P.M.\r\n -Ardhajama Pooja 09.00 P.M.', 'The biggest and most revered festival of the temple is the annual Brahmotsavam, which takes place in the Tamil month of Panguni. The nine-day long spring festival starts with flag hoisting or Dwajarohanam, then the chariot procession of the deities or the therotsavam, followed by Arupathimoovar on the eighth day, and finally concluded by Tirukkalyanam or the marriage between Kapaleeswarar and Karp', 'Kapaleesvarar,Kesava Perumal Sannathi St,Vinayaka Nagar Colony,Mylapore,Chennai,Tamil Nadu,India'),
(8, 'Karpaga Vinayaga', 'Karpaka Vinayakar Temple', 'Karpaka Vinayaka Temple or Pillaiyarpatti Pillaiyar Temple is an ancient rock-cut cave shrine dedicated to Lord Ganesha', '-Thiruvanandal Abhishekam 06.00 A.M - 06.30 A.M\r\n -Kaalasanthi Abhishekam 08.30 A.M - 09.30 A.M\r\n -Uchikalam Abhishekam 11.30 A.M - 12.00 P.M\r\n -Maalaisanthi or Sayaratsai 05.00 P.M - 06.30 P.M\r\n -Iravusanthi or Arthajaman 07.45 P.M - 08-30 P.M', 'Vinayaga Chathurthi celebrated during the Avani [August-September] month every year is the most auspicious occasion in the Karpaga Vinayagar Temple. It is a 10 days grand festival, and by the 6th day onwards cultural programs are conducted to entertain the rushing crowd.', 'Pillaiyarpatti,Tiruppattur Taulk,Sivagangai District,TamilNadu,India'),
(9, 'Lord Vishnu', 'Koodal Azhagar temple', 'The ornamental windows of the temple is another unique feature of the temple. The beautifully done wooden panels are rich with intricate carvings that portray scenes from Hindu mythology. The temple tower has the story of Ramayana depicted on sculptures placed on each floor of the tower. Each of these masterpieces is worth marvelling', 'Darshan timings at Koodal Azhagar temple are from 5.30 PM to 12 Pm in morning. In evening it opens from 4 PM to 9 PM.', 'Four daily rituals and three yearly festivals are held at the temple, of which the fourteen-day annual Brahmotsavam during the Tamil month of Vaikasi (May - June) being the most prominent. The temple is maintained and administered by the Hindu Religious and Endowment Board of the Government of Tamil Nadu.', 'Perumal Koil Sannathi Street Near Periyar Bus Stand,Periyar,Madurai,Tamil Nadu,India'),
(10, 'Lord Muruga', 'Marudhachalamurthy Temple', 'Marudhamalai (temple) Marudhachalamurthy (Lord Muruga) Temple, Marudamalai is a popular 12th century hill temple build by Tamil kings during sangam period as shown in purananuru and dedicated to Thamizh god Murugan.', '-6.00 AM to 1.00 Noon\r\n -2.00 PM to 8.30 PM', '-Thai poosam is celebrated every year in January.\r\n -Tamil New Year is celebrated on January 14th every year.\r\n -Kiruthikai day of every month is very popular and many devotees regularly visit this temple.\r\n -Vaikashi car festival is quite famous at Marudamalai.\r\n -Adi Peruku during Aadi month is celebrated here in a nice manner.\r\n -Navarathri pooja has its importance at this temple.\r\n -Karthikai Deepam festival during Karthikai month is nicely celebrated here.\r\n -Margali pooja are conducted during December month.\r\n -Arudhra Darisanam is another important festival celebrated at Marudamalai.\r\n', 'Temple Rd,Marudhamalai Adivaram,Coimbatore,Tamil Nadu,India');

